package leetcode.topinterviewquestionseasy.strings;

class StrStr {
    public static int strStr(String haystack, String needle) {
        for (int i = 0; ; i++) {
            for (int j = 0; ; j++) {
                if (j == needle.length())
                    return i;
                if (i + j == haystack.length())
                    return -1;
                if (needle.charAt(j) != haystack.charAt(i + j))
                    break;
            }
        }
    }

    public static int strStr3(String haystack, String needle) {
        if (needle.isEmpty()) {
            return 0;
        }
        if (needle.length() > haystack.length()) {
            return -1;
        }

        int j = 0;
        for (int i = 0; i < haystack.length(); i++) {
            if (needle.charAt(j) == haystack.charAt(i)) { //start searching
                int pos = checkCandidate(haystack, needle, i);
                if (pos != -1) {
                    return pos;
                }
            }
        }
        return -1;
    }

    private static int checkCandidate(final String haystack, final String needle, final int i) {
        int j = 0;
        for (int i1 = i; i1 < haystack.length() && j < needle.length(); i1++) {
            if (haystack.charAt(i1) == needle.charAt(j)) {
                j++;
            } else {
                return -1;
            }
        }
        return j == needle.length() ? i : -1;
    }

    public static int strStrTooLong(String haystack, String needle) {
        if (needle.isEmpty()) {
            return 0;
        }
        if (needle.length() > haystack.length()) {
            return -1;
        }

        int foundSoFar = 0;
        int pos = -1;
        for (int i = 0; i < haystack.length(); i++) {
            if (needle.charAt(foundSoFar) == haystack.charAt(i)) { //start searching
                if (foundSoFar == 0) {
                    pos = i;
                }
                foundSoFar++;
                if (foundSoFar == needle.length()) {
                    return pos;
                }
            } else {
                if (pos > -1) {
                    i = pos;
                }
                pos = -1;
                foundSoFar = 0;
            }
        }
        return foundSoFar == needle.length() ? pos : -1;
    }

    public static int strStrJava(String haystack, String needle) {
        if (needle.isEmpty()) {
            return 0;
        }

        return haystack.indexOf(needle);
    }

    public static void main(String[] args) {
        System.out.println(strStr("mississippi", "issipi"));
        System.out.println(strStr("mississippi", "issip"));
        System.out.println(strStr("hello", "ll"));
        System.out.println(strStr("aaaaa", "bba"));
        System.out.println(strStr("", ""));
        System.out.println(strStr(
                "",
                ""));
        System.out.println(strStr("mississippi", "pi"));
    }
}
